open Ltype
open Hw1
open List
open Map

type lambda_ref = | Var_ref of string| Abs_ref of string * lambda_ref ref| App_ref of lambda_ref ref * lambda_ref ref

module String_Map = Map.Make(String);;

let id = ref 0;;

let new_name () = 
	let name = "n"^(string_of_int (!id)) 
	in id := !id + 1; name;;


let free_vars lb = 
	let rec get_free_vars lb free except = 
		match lb with
		| Var x -> 
			if not (List.mem x free) && not (List.mem x except) then x :: free 
			else free
		| App (p, q) -> get_free_vars p (get_free_vars q free except) except
		| Abs (x, p) -> get_free_vars p free (x :: except)
	in get_free_vars lb [] [];;

let rec free_to_subst what lb var = 
	match lb with
	| Var _ -> true
	| Abs (x, p) -> x = var || (not (List.mem x (free_vars what)) && free_to_subst what p var)
	| App (p, q) -> free_to_subst what p var && free_to_subst what q var;;

let rec subst what lb var = 
	match lb with
	| Var x -> if x = var then what else lb
	| App (p, q) -> App (subst what p var, subst what q var)
	| Abs (x, p) -> if x = var then lb else Abs (x, subst what p var);;

let rec is_normal_form lb = 
	let rec check p q =	
		match p with
		| Abs(x, p1) -> if(free_to_subst q p x) then false else is_normal_form p1
		| _ -> is_normal_form p && is_normal_form q
	in match lb with
	| App(p, q) -> check p q
	| Abs(x, p) -> is_normal_form p
	| _ -> true;;

let rec is_alpha_equivalent l1 l2 =
	match l1, l2 with
		| Var x1, Var x2 -> x1 = x2
		| App (p1, q1), App (p2, q2) -> is_alpha_equivalent p1 p2 && is_alpha_equivalent q1 q2
		| Abs (x1, p1), Abs (x2, p2) -> 
			let t = Var (new_name())
			in is_alpha_equivalent (subst t p1 x1) (subst t p2 x2)
		| _ -> false;;

let rename lb = 
	let rec real_rename lb vars = 
		match lb with
		| Var x -> (try String_Map.find x vars with Not_found -> lb)
		| Abs (x, p) -> let name = new_name() in Abs (name, real_rename p (String_Map.add x (Var name) vars))
		| App (p, q) -> App (real_rename p vars, real_rename q vars)
	in real_rename lb String_Map.empty;; 


let normal_beta_reduction lambda = 
	let rec reduce_normal lb = 
		if is_normal_form lb then lb 
		else match lb with
		| Var _ -> lb
		| Abs (x, p) -> Abs (x, reduce_normal p)
		| App (Abs (x, p), q) -> subst q p x
		| App (p, q) -> if is_normal_form p then App (p, reduce_normal q) else App (reduce_normal p, q)
	in reduce_normal (rename lambda);;

let rec from_ref lb = 
	match !lb with
	| Var_ref x -> Var x
	| Abs_ref (x, p) -> Abs (x, from_ref p)
	| App_ref (p, q) -> App (from_ref p, from_ref q);;

let rec to_ref lb = 
	match lb with
	| Var x -> ref (Var_ref x)
	| Abs (x, p) -> ref (Abs_ref (x, to_ref p))
	| App (p, q) -> ref (App_ref (to_ref p, to_ref q));;

let copy lb =
	let rec copy_renaming lb vars = 
		match !lb with
		| Var_ref x -> (try ref (String_Map.find x vars) with _ -> ref (Var_ref x))
		| Abs_ref (x, p) -> 
			let name = new_name() in ref (Abs_ref (name, copy_renaming p (String_Map.add x (Var_ref name) vars)))
		| App_ref (p, q) -> ref (App_ref (copy_renaming p vars, copy_renaming q vars))
	in copy_renaming lb String_Map.empty;;

let rec subst_lref what lb var = 
	match !lb with
	| Var_ref x -> if x = var then lb := !what
	| Abs_ref (x, p) -> if x != var then subst_lref what p var
	| App_ref (p, q) -> subst_lref what p var; subst_lref what q var;;

let rec reduction_with_memoisation lb = 
	match !lb with
	| Var_ref _ -> false
	| Abs_ref (x, p) -> reduction_with_memoisation p
	| App_ref (p, q) -> 
		match !p with
		| Abs_ref(x, m) -> lb := !(copy m); subst_lref q lb x; true
		| _ -> reduction_with_memoisation p || reduction_with_memoisation q ;;

let rec reduction lb = if reduction_with_memoisation lb then reduction lb else lb;;
let reduce_to_normal_form lb = from_ref (reduction (copy (to_ref (lb))));;

let print_lambda x = print_endline (string_of_lambda x);;
let runtest name lambda_str = 
	let start = Sys.time() in
	print_endline ("running " ^ name);
	print_lambda (reduce_to_normal_form (lambda_of_string lambda_str));
	Printf.printf "Execution time: %fs\n\n" (Sys.time() -. start);;

